import React, { Component } from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Accordion from "react-bootstrap/Accordion";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import Vison from "../Components/Vision"
import {H2Style } from '../Helpers/stlyes'

export default class Home extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
        <div style={{ backgroundColor: "#1e252d", width: '100vw', height: "100vh" }}>
      <Container fluid style={{ padding: 0, backgroundColor: "#1e252d" }}>
          <Row>
            <Col style={{ textAlign: "center" }}>
              <h1
                style={H2Style}
              >
                <a style={{ color: "white"}} href="index.html">
                  CodeLive Senior Project
                </a>
              </h1>
            </Col>
          </Row>
          <br /> <br />
          <Accordion>
            <Vison/>
            <Card style={{ backgroundColor: "#1e252d" }}>
              <Card.Header>
                <Accordion.Toggle as={Button} variant="link" eventKey="1">
                  Click me!
                </Accordion.Toggle>
              </Card.Header>
              <Accordion.Collapse eventKey="1">
                <Card.Body>Hello! I'm another body</Card.Body>
              </Accordion.Collapse>
            </Card>
          </Accordion>
      </Container>
      </div>
    );
  }
}
